description:
Production year: 2014

Country: USA

Genre: Comedy, Couples, Feature

Length: 2:00:31

Language: English

Directed by: Stormy Daniels

Studio: Wicked Pictures

Cast: Dahlia Sky, Gabriella Paltrova, Lea Lexis, Misty Stone, Stormy Daniels

Description: Co-workers Carrie and Justin are both in need of some extra money. Carrie's looking for her own place, after discovering her boyfriend's secret sex tape and Justin's saving for an expensive engagement ring to satisfy his obnoxious girlfriend. As a result, they join forces and begin working odd jobs for extra money and before long ... they begin to fall in love. With scintillating sex and 'laugh out loud' dialogue, &quot;Dirty Deeds&quot; will satisfy couples and fans of romantic comedies, as well as fans of, star and director, Stormy Daniels.
